import React, { Component } from "react";

class Selector extends React.Component {
  state = {
    counters: [
      { id: 1, value: 4 },
      // { id: 2, value: 0 },
      // { id: 3, value: 0 },
      // { id: 4, value: 0 },
    ],
  };

  render() {
    return (
      <div className="m-2">
        <span className="me-2">Error type: </span>
        <div className="btn-group">
          <input
            type="checkbox"
            className="btn-check"
            id="btn-check"
            autocomplete="off"
          />
          <label className="btn btn-outline-primary" for="btn-check">
            Single toggle
          </label>
          <input
            type="checkbox"
            className="btn-check"
            id="btn-check"
            autocomplete="off"
          />
          <label className="btn btn-outline-primary" for="btn-check">
            Single toggle
          </label>
        </div>
      </div>
    );
  }
}

export default Selector;
